import React from 'react'
import Head from 'next/head'
import Router from 'next/router'

const SchoolPage = ({router}) => {

    return(
        <div>
            <Head>
                <title>School Name</title>
            </Head>
            <p onClick={()=>Router.back()}>School Page</p>
        </div>
    )
}

export default withRouter(SchoolPage)
